import React from "react";
import api from "../api/index";
import { useEffect } from "react";
import { useState } from "react";

const Posts = () => {
  const [users, setUsers] = useState();
  useEffect(() => {
    api.data.fetchAll().then((data) => setUsers(data));
  }, []);

  return (
    <>
      <h1>Posts</h1>
    </>
  );
};

export default Posts;
